import React from 'react';
import '../../App.css';
import './style.css'

const Skills = (props) => {
  return (
	<div className="container container-md" id="skills-container">
	  <div className="skills-header" id="skills-title1">
		<h3 className="skills-title"><strong>Skills</strong></h3>
	  </div>

	  <div className="skills__list">
		<h3>Front-end</h3>
		<div className="skills__front-end"></div>
	  </div>
	  <div className="skills__back-end">
		<h3>Back-end</h3>
	  </div>
	  <div className="skills__other">
		<h3>Other</h3>
	  </div>
	</div>
  )
}

export default Skills;
